import React from 'react'; 
import PropTypes from 'prop-types'


const PostImges = ({images})=>{

    if(images.length ===1){
        return (
            <img src={`http://captainryan.gonetis.com:3065/${images[0].src}`}/>
        );
    };

    if(images.length ===2){
        return (
            <div>
            <img src={`http://captainryan.gonetis.com:3065/${images[0].src}`}  width="50%"/>
            <img src={`http://captainryan.gonetis.com:3065/${images[1].src}`}  width="50%"/>
            </div>
        );
    };


    return (
        <div>
            <img src={`http://captainryan.gonetis.com:3065/${images[0].src}`}  width="50%"/>
            <div style={{display:'inline-block', width:'50%', textAlign:'center', verticalAlign:'middle'}}>
            +
            <br />
            {images.length-1}
            개 사진 더 보기
            </div>
        </div>

    )
}

PostImges.propTypes = {
    images : PropTypes.arrayOf(PropTypes.shape({
        src : PropTypes.string,
    })).isRequired,
}; 

export default PostImges;
